css:
atom-workspace {
  display: flex;
  flex-direction: column;
  height: 100%;
  overflow: hidden;
  position: relative;
  color: #444444;
  background-color: #cccccc;
  font-family: '.SFNSText-Regular', 'SF UI Text', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
}
atom-workspace atom-workspace-axis {
  position: relative;
}
atom-workspace atom-workspace-axis.horizontal {
  display: flex;
  flex: 1;
}
atom-workspace atom-workspace-axis.vertical {
  display: flex;
  flex: 1;
  flex-direction: column;
  min-width: 0;
}
